INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','Dostawa','Warunki i zasady dostawy','conditions, delivery, delay, shipment, pack, dostawa, opóźnienie, paczka','<h1><strong>Przesyłki i zwroty</strong></h1>\n<p><strong>Twoja przesyłka paczki</strong></p>\n<p>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z opcją śledzenia i nadania bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jaką wysyłkę wybierzesz, udostępnimy Ci link do śledzenia przesyłki online.</p>\n<p>Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować przedmioty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja przesyłka zostanie wysłana na własne ryzyko, ale dokładamy szczególnej staranności, aby chronić delikatne przedmioty.</p>\n<p>Pudełka są odpowiednio duże, a Twoje przedmioty są dobrze chronione.</p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','notice, legal, credits, prawo, nota, prawna','<h1><strong>Prawny</strong></h1>\n<h2><strong>Kredyty</strong></h2>\n<p>Koncepcja i produkcja:</p>\n<p>Ta witryna internetowa została stworzona przy użyciu oprogramowania open-source PrestaShop™.</p>','nota-prawna'),(3,1,1,'Regulamin użytkowania','','Regulamin użytkowania','conditions, terms, use, sell, regulamin, użytkowanie','<h1>Zasada 1</h1>\n<p>Stawiamy tylko pozytywne oceny za projekt :D</p>\n<p></p>\n<h1>Zasada 2</h1>\n<p>Nie obowiązuję inne zasady aniżeli zasada 1</p>\n<p></p>\n<h1>Zasada 3</h1>\n<p>Wszystkie zasady są obowiązkowe.</p>','regulamin-uzytkowania'),(4,1,1,'O nas','','Dowiedz się o nas więcej','about us, informations, o nas, informacje, sklep, info, about','<h2>O nas</h2>\n<p>Jesteśmy zespołem składającym się z 4 osób - Macieja, Bartłomieja, Aleksandra i Grzegorze. Razem, w grupie, zmagamy się z codziennymi wyzwaniami studenta Politechniki Gdańskiej. </p>\n<p>Razem wierzymy, że uda nam się zdać projekt z Biznesu Elektronicznego z bardzo dobrą oceną.</p>','o-nas'),(5,1,1,'Bezpieczeństwo płatności','','Sprawdź nasze zabezpieczenia płatności.','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczeństwo płatności</h2>\n<h3>Używamy Visa/Mastercard/Paypal i inne bezpieczne sposoby płatności</h3>\n<p>Nie bierzemy żadnej odpowiedzialności za błędy pośredników płatności.</p>','bezpieczenstwo-platnosci-');
