INSERT INTO `ps_info_lang` VALUES (1,1,1,'<h1 dir=\"ltr\" style=\"line-height:1.38;margin-top:18pt;margin-bottom:4pt;\" id=\"docs-internal-guid-7874703d-7fff-995e-cc8b-6249ee225c7e\"><span style=\"font-size:17pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:bold;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">LAMPOWNIA</span></h1>\n<h1><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:bold;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Dlaczego to nas powinieneś wybrać?</span></h1>\n<h1 style=\"text-align:center;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Lampy i żyrandole stanowią nieodzowną część naszych domów i mieszkań. Warto zadbać, aby przestrzeń w której mieszkamy była wyposażona w odpowiednio dobrane oświetlenie. Wybór jest spory. Na rynku polskim jest ponad kilkanaście tysięcy wzorów lamp i oświetlania. Duży wybór lamp możemy znaleźć w popularnych marketach budowlanych jak Obi, Leroy Merlin czy Castorama. Jednakże ta oferta producentów oświetleniowych jest cząstkowa, zatem gdzie jest największy wybór lamp? Oczywiście w internecie. Nasz sklep współpracuje z najbardziej renomowanymi producentami lamp w Polsce, dlatego też oferta lamp w naszym sklepie internetowym jest kompletna. Na dzień dzisiejszy w bazie naszego sklepu znajduje się ponad 500 wzorów lamp, a oferta z każdym rokiem jest nieustannie rozszerzana o nowe produkty.</span></h1>\n<h2 style=\"text-align:center;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\"></span></h2>\n<p style=\"text-align:center;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\"></span></p>');
/*!40000 ALTER TABLE `ps_info_lang` ENABLE KEYS */;
UNLOCK TABLES;

